import React, { Component } from 'react';
import CarMake from './CarMake'

class CarMakesList extends Component {

  render() {
    const { makes } = this.props
    console.log(makes);
    return (
      <div>
        Here are some car makes....
        {
          makes.map((make) => {
            return <CarMake key={make.id} make={make}/>
          })
        }
      </div>
    );
  }

}

export default CarMakesList;
